// DogRunPage.tsx
import React from "react";
import "./DogRunPage.css";
import dogrun from "../assets/images/dogrun.png";
import dogrunNationwide from "../assets/images/dogrun.nationwide.png";

const DogRunPage: React.FC = () => {
  return (
    <div className="dogrun-page">
      <h2 className="dogrun-title">全国のドッグランを探す</h2>
      <div className="dogrun-img">
        <img
          src={dogrun}
          alt="ドッグランのイラスト"
          className="dogrun-illust"
        />
      </div>
      <img src= {dogrunNationwide}  alt="全国のドッグランの表示" 
      className="dogrunNationwide"/>
    </div>
  );
};

export default DogRunPage;
